import { Link } from "react-router-dom";

const Navbar = () => {
  return ( 
    <nav className="navbar">
      <Link to='/'>
      <h1>NOTELY</h1>
      </Link>
      <div className="links">
        <Link to='/'>HOME</Link>
        <Link className="new_btn" to='/create'>NEW NOTE</Link>
      </div>
    </nav>
  );
}

export default Navbar
